export const initialState = {
    id: "79mWpD",
    title: "Lespo",
    typeVariant: 0,
    price: 3.43,
    inputs: {
        username: {
            label: "Enter your nickname",
        },
        twitch: {
            label: "Your channel",
        },
        facebook: {
            label: "Specify your facebook link",
        },
    }
}

export default function orderFormReducer(state = initialState, {type, payload = null}) {
    switch (type) {
        case '':
            return {...state,}

        default:
            return state
    }
}
